$(window).load(function () {
    $("div[data-demo-type='video']").each(function () {
        $(this).find(".image-item").each(function () {
            $(this).mouseover(function () {
                $(this).children("div").show();
            }).mouseout(function () {
                if ($(this).children("div").hasClass('image-item-hover')) {
                    $(this).children(".image-item-hover").hide();
                }
            });
        });
    });

    $("div[data-name='PlayOrPauseDiv']").click(function () {
        $("div[data-name='PlayOrPause']", $(this).parents("div[data-demo-type='video']")).click();
    });

});

function ChangeVideoSrcUrl(con, videoId, newMp4VideoUrl, newWebmVideoUrl, newImgUrl, num) {
    $("div[data-name='ImgDiv']", $(con).parents("div[class='video-demo']")).get(0).style.backgroundImage = "url(" + newImgUrl + ")";
    $("div[data-name='ImgDiv']", $(con).parents("div[class='video-demo']")).removeClass("displaynone");
    $("div[data-name='play_icon']", $(con).parents("div[class='video-demo']")).addClass("displaynone");
    $("div[data-name='loading_icon']", $(con).parents("div[class='video-demo']")).removeClass("displaynone");
    $("input[data-name='videoId']", $(con).parents("div[class='video-demo']")).attr("value", videoId);
    initContent(con);
    $("video", $(con).parents("div[class='video-demo']")).hide();
    var video = $("video", $(con).parents("div[class='video-demo']")).get(0);
    video.pause();
    //video.src = newVideoUrl;
    $("source[data-name='MP4']", video).get(0).src = newMp4VideoUrl;
    $("source[data-name='webm']", video).get(0).src = newWebmVideoUrl;

    video.load();

    if (num != null) {
        switch (num) {
            case 0:
                MotionDetectionStepInfo = JSON.parse(str1);
                break;
            case 1:
                MotionDetectionStepInfo = JSON.parse(str2);
                break;
            case 2:
                MotionDetectionStepInfo = JSON.parse(str3);
                break;
            case 3:
                VideoInfo = VideoInfo1;
                break;
            case 4:
                VideoInfo = VideoInfo2;
                break;
            case 5:
                VideoInfo = VideoInfo3;
                break;
        }
    }

    video.oncanplay = video.play();
}

function PlayVideo(con) {
    //$("div[data-name='ImgDiv']", $(con).parents("div[class='video-demo']")).addClass("displaynone")
    $("div[data-name='loading_icon']", $(con).parents("div[class='video-demo']")).removeClass("displaynone")
    $("div[data-name='play_icon']", $(con).parents("div[class='video-demo']")).addClass("displaynone")
    var video = $("video", $(con).parents("div[class='video-demo']")).get(0);
    video.play();
    //video.msRequestFullscreen();
}

function PlayOrPauseVideo(con) {
    var video = $("video", $(con).parents("div[class='video-demo']")).get(0);
    var playOrPauseDiv = $("div[data-name='PlayOrPause']", $(con).parents("div[class='video-demo']"));
    var videoStatus = video.paused || video.ended;
    if (videoStatus) {   //Pause --> Play
        video.play();

        //video.msRequestFullscreen();        
        playOrPauseDiv.removeClass("Play-Style");
        playOrPauseDiv.addClass("Pause-Style");
    }
    else {  //Play --> Pause
        video.pause();
        playOrPauseDiv.removeClass("Pause-Style");
        playOrPauseDiv.addClass("Play-Style");
    }
}

function VolumeClick(con) {
    var volumeData = $("div[data-name='volumeData']", $(con).parents("div[class='videocontrol']"));
    if (volumeData.get(0).classList.length > 1) {
        volumeData.removeClass("displaynone");
    }
    else {
        volumeData.addClass("displaynone");
    }
}

function GetHMSFormat(seconds) {
    var hour = (seconds / 3600).toFixed(0);
    var minute = (seconds % 3600 / 60).toFixed(0);
    var second = (seconds % 3600 % 60).toFixed(0);

    return (hour < 10 ? "0" + hour : hour) + ":" + (minute < 10 ? "0" + minute : minute) + ":" + (second < 10 ? "0" + second : second);
}

function initContent(con) {
    var videoId = $("input[data-name='videoId']", $(con).parents("div[class='video-demo']")).val();
    //$("a", $(con).parents("div[class='video-demo']")).removeClass("a_focused");
    //$("a", $(con).parents("div[class='video-demo']")).removeClass("a_losefocus");
    //$("a[id='TABLE']", $(con).parents("div[class='video-demo']")).addClass("a_focused");
    //$("a[id='JSON']", $(con).parents("div[class='video-demo']")).addClass("a_losefocus");
    $("li", $(con).parents("div[class='video-demo']")).removeClass("ui-nav-active");
    $("a[id='TABLE']", $(con).parents("div[class='video-demo']")).parents("li").addClass("ui-nav-active");

    var type = "TABLE";
    content = getContent(type, videoId);
    $("pre[data-name='code']", $(con).parents("div[class='video-demo']")).html(content);
}

function setContent(con) {
    if ($(con).parent().hasClass('ui-corner-top-a-white')) {
        $(con).parent().removeClass('ui-corner-top-a-white');
        $(con).parent().siblings().addClass('ui-corner-top-a-white');
    }
    

    var videoId = $("input[data-name='videoId']", $(con).parents("div[class='video-demo']")).val();
    //$("a", $(con).parents("ul")).removeClass("a_focused");
    //$("a", $(con).parents("ul")).addClass("a_losefocus");
    //$(con).removeClass("a_losefocus");
    //$(con).addClass("a_focused");

    $("li", $(con).parents("ul")).removeClass("ui-nav-active");
    $(con).parents("li").addClass("ui-nav-active");

    var content;
    var type = "JSON";
    switch (con.id) {
        case "JSON":
            type = "JSON";
            break;
        case "TABLE":
            type = "TABLE";
            break;
        default:
            type = "JSON";
            break;
    }
    content = getContent(type, videoId);
    $("pre[data-name='code']", $(con).parents("div[class='video-demo-right']")).html(content);
}

